USE master;
GO

IF DATABASEPROPERTYEX('ClusteredStructure', 'status') IS NOT NULL DROP DATABASE ClusteredStructure;
GO

CREATE DATABASE ClusteredStructure;
GO

SET NOCOUNT ON
GO

USE ClusteredStructure;
GO

CREATE TABLE dbo.TestStructure
(
id INT  NOT NULL IDENTITY,
filler1 CHAR(36) NOT NULL DEFAULT 'a',
filler2 CHAR(216) NOT NULL DEFAULT 'b'
);
GO

/*

SELECT OBJECT_NAME(object_id) AS table_name,
name AS index_name, type, type_desc
FROM sys.indexes
WHERE object_id = OBJECT_ID(N'dbo.TestStructure', N'U');
go

*/

CREATE CLUSTERED INDEX PK_TestStructure ON dbo.TestStructure(id);
GO

